import React from "react";
import mainBoard from "./mainBoard.css";

function App() {
  return (
    <>
      <table className="mainBoard">
        <th>번호</th>
        <th width="200">제목</th>
        <th>작성자</th>
        <th width="30">작성일</th>
        <th>조회수</th>
        <tr>
          <td>1</td>
          <td>게시판 이용규칙</td>
          <td>운영자</td>
          <td>2020.09.17</td>
          <td>1</td>
        </tr>
      </table>
    </>
  );
}

export default App;
